-- ----------------------------
-- Table structure for action_record
-- ----------------------------
DROP TABLE IF EXISTS `action_record`;
CREATE TABLE `action_record`  (
  `action_id` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '操作ID',
  `trade_id` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '申请记录ID或者借款账单ID',
  `trade_type` tinyint(1) NOT NULL COMMENT '账单类型：1 借款  、 2 还款',
  `user_id` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户ID',
  `action_type` tinyint(1) NOT NULL COMMENT '操作类型： 1 审核 、 2 还款、 4 部分还款、5出款',
  `info` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '操作行为信息 -json格式     审核：{operator_id(操作人id)...}     还款：{amount_fee(还款金额)，remain_fee(剩余待还款金额)...}    催收：{operator_id(跟进人id)...}',
  `trade_status` tinyint(1) NOT NULL COMMENT '对应订单状态',
  `is_delete` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1正常 、删除',
  `create_time` int(10) NOT NULL COMMENT '添加时间',
  `update_time` int(10) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`action_id`) USING BTREE,
  INDEX `trade_id_key`(`trade_id`) USING BTREE,
  INDEX `user_id_key`(`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '操作记录表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of action_record
-- ----------------------------

