CREATE TABLE `advert`  (
  `advert_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '广告编号',
  `name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '名称',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1 外部链接 2 关联商品 3 挂售订单',
  `adv_position` int(11) NOT NULL DEFAULT 0 COMMENT '广告位: 分类.enum表的value',
