DROP TABLE IF EXISTS `bill`;
CREATE TABLE `bill`  (
  `bill_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '贷款ID',
