DROP TABLE IF EXISTS `call_api`;
CREATE TABLE `call_api`  (
  `id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '',
  `user_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `api_provider` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '接口服务商',
  `api_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT 'phone/riskscore:手机号风险评测\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\ndxantifraud:贷前综合风险评估\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\ncarrierOrigReport:运营商原始报告\\\\\\\\\\\\\\\\ncarrierAnayReport: 运营商分析报告\\\\\\\\\\\\nnameCardValidate:实名认证\\\\\\\\bankcardFourVerify:银行卡验证\\\\taobaoAnayReport:淘宝数据\\r\\n\\\\alipayVerify支付宝认证\\phoneBook:通讯录\r\n\\\\sms短信',
  `request` json NULL COMMENT '请求数据',
  `response` json NULL COMMENT '响应数据',
  `status` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '状态 (success:成功 失败:fail 网络错误:error )',
  `create_time` int(10) NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

