-- ----------------------------
-- Table structure for loan
-- ----------------------------
DROP TABLE IF EXISTS `loan`;
CREATE TABLE `loan`  (
  `loan_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '贷款ID',
  `user_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '用户ID',
  `product_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '产品ID',
  `borrow_money` int(18) NOT NULL DEFAULT 0 COMMENT '借款金额',
  `rete` float(4, 2) NOT NULL DEFAULT 0.00 COMMENT '借款利率',
  `risk_cost` int(18) NOT NULL DEFAULT 0 COMMENT '风控金额',
  `days` int(18) NOT NULL DEFAULT 0 COMMENT '借款天数',
  `overdue_rate` float(4, 2) NOT NULL DEFAULT 0.00 COMMENT '逾期利率',
  `postpone_enable` int(18) NOT NULL DEFAULT 0 COMMENT '是否可以延期',
  `postpone_fee` int(18) NOT NULL DEFAULT 0 COMMENT '展期费用',
  `postpone_manage_fee` int(18) NOT NULL DEFAULT 0 COMMENT '展期管理费',
  `loan_status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1 待审核 2 待放款  3 还款中  4 展期  5借款完成 6申请不通过 7关闭（借款审核通过未领取）',
  `create_time` int(10) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `receive_loan_time` int(10) NOT NULL DEFAULT 0 COMMENT '领取借款时间',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1正常  2 删除',
  `reset_user_verify_time` int(10) NOT NULL DEFAULT 0 COMMENT '重置用户认证时间',
  PRIMARY KEY (`loan_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '贷款信息表' ROW_FORMAT = Dynamic;

