-- ----------------------------
-- Table structure for pay_flow
-- ----------------------------
DROP TABLE IF EXISTS `pay_flow`;
CREATE TABLE `pay_flow`  (
  `pay_id` char(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '请求流水号ID',
  `user_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户ID,user表主键',
  `trade_no` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '借款编号/账单编号',
  `out_trade_no` char(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'cs订单号,回调时需要填充，可能为空',
  `trade_type` tinyint(2) NOT NULL DEFAULT 1 COMMENT '交易类型 1 放款 2 还款 3手动还款',
  `mobile` char(11) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户手机号，冗余字段',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '标题',
  `total_amount` int(10) NOT NULL DEFAULT 0 COMMENT '订单金额',
  `pay_type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '支付方式  1支付宝 2银行卡  3线下现金还款',
  `request_param` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '请求参数',
  `callback` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '同步返回数据',
  `notify` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '异步返回数据',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1待付款 2 交易成功 3交易失败 4交易关闭 5处理中',
  `create_time` int(10) NOT NULL DEFAULT 0 COMMENT '发起支付时间',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '异步返回时间',
  PRIMARY KEY (`pay_id`) USING BTREE,
  INDEX `index_trade_no`(`trade_no`) USING BTREE,
  INDEX `index_out_trade_no`(`out_trade_no`) USING BTREE,
  INDEX `index_member_id`(`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = 'comsunny支付订单' ROW_FORMAT = Dynamic;

