CREATE TABLE `risk`  (
  `risk_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '',
  `loan_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `user_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `mobile` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `idcard` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '',
  `api_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT 'phone/riskscore:手机号风险评测\\\\ndxantifraud:贷前综合风险评估\\\\ncarrierOrigReport:运营商原始报告\\ncarrierAnayReport: 运营商分析报告',
  `request` json NULL COMMENT '请求数据',
  `response` json NULL COMMENT '响应数据',
  `status` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '状态 (success:成功 失败:fail 处理中:processing )',
  `create_time` int(10) NULL DEFAULT 0,
  `update_time` int(10) NULL DEFAULT 0,
  PRIMARY KEY (`risk_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of risk
-- ----------------------------

-- ----------------------------
-- Table structure for risk_model
-- ----------------------------
DROP TABLE IF EXISTS `risk_model`;
CREATE TABLE `risk_model`  (
  `model_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '主键',
  `level` tinyint(1) NOT NULL DEFAULT 1 COMMENT '风控等级',
  `rule_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '规则名称',
  `type` tinyint(255) NOT NULL DEFAULT 1 COMMENT '1  指定函数  2 指定对比数据key',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '指定地址',
  `arguments` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '函数[指定配置]  参数[直接对比数据]',
  `sort` int(5) NOT NULL DEFAULT 0 COMMENT '排序',
  `is_delete` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0 正常  1 删除',
  `create_time` int(10) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '修改时间',
  PRIMARY KEY (`model_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '风控模型' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of risk_model
-- ----------------------------

