-- ----------------------------
-- Table structure for settings
-- ----------------------------
DROP TABLE IF EXISTS `settings`;
CREATE TABLE `settings`  (
  `set_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `set_key` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '配置键名',
  `set_val` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '值',
  `name` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '名称',
  `type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '类型：1-系统设置相关，2-系统关闭相关',
  `prop` tinyint(1) NOT NULL DEFAULT 2 COMMENT '取值属性：1-百分比，2-固定值',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '备注信息',
  PRIMARY KEY (`set_id`) USING BTREE,
  INDEX `index_set_key`(`set_key`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统全局参数设置' ROW_FORMAT = Dynamic;

