-- ----------------------------
-- Table structure for statistics_record
-- ----------------------------
DROP TABLE IF EXISTS `statistics_record`;
CREATE TABLE `statistics_record`  (
  `dateline` int(8) NOT NULL DEFAULT 0 COMMENT '主键  统计日期 YYYYMMDD',
  `register_member` int(10) NOT NULL DEFAULT 0 COMMENT '注册人数',
  `real_name` int(10) NOT NULL DEFAULT 0 COMMENT '实名制',
  `ali_cert` int(10) NOT NULL DEFAULT 0 COMMENT '支付宝认证',
  `zhima_cert` int(10) NOT NULL DEFAULT 0 COMMENT '芝麻分',
  `phone_book_cert` int(10) NOT NULL DEFAULT 0 COMMENT '通讯信息',
  `bank_card` int(10) NOT NULL DEFAULT 0 COMMENT '银行卡',
  `operator_mer` int(10) NOT NULL DEFAULT 0 COMMENT '运营商',
  `order_apply` int(10) NOT NULL DEFAULT 0 COMMENT '订单申请数',
  `order_pass` int(10) NOT NULL DEFAULT 0 COMMENT '订单通过数',
  `loan_success` int(10) NOT NULL DEFAULT 0 COMMENT '放款成功数',
  `apply_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '申请转化率',
  `review_pass_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '审核通过率',
  `overdue_num` int(10) NOT NULL DEFAULT 0 COMMENT '正在逾期个数',
  `overdue_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '逾期率',
  `overdue_first_num` int(10) NOT NULL DEFAULT 0 COMMENT '首逾个数',
  `overdue_first_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '首逾率',
  `overdue_day3_num` int(10) NOT NULL DEFAULT 0 COMMENT '3日内逾期个数',
  `overdue_day3_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '3日内逾期率',
  `overdue_day5_num` int(10) NOT NULL DEFAULT 0 COMMENT '5日内逾期个数',
  `overdue_day5_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '5日内逾期率',
  `overdue_day7_num` int(10) NOT NULL DEFAULT 0 COMMENT '7日内逾期个数',
  `overdue_day7_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '7日内逾期率',
  `overdue_day15_num` int(10) NOT NULL DEFAULT 0 COMMENT '15日内逾期个数',
  `overdue_day15_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '15日内逾期率',
  `should_repay_num` int(10) NOT NULL DEFAULT 0 COMMENT '应还账单数',
  `real_repay_num` int(10) NOT NULL DEFAULT 0 COMMENT '实际还款账单数',
  `continue_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '续期占比',
  `all_repay_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '全额还款占比',
  `repayment_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '还款率',
  `new_user_rapay_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '新客还款率',
  `old_user_repay_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '老客还款率',
  `bill_pay_num` int(10) NOT NULL DEFAULT 0 COMMENT '放款账单数量',
  `bill_continue_num` int(10) NOT NULL DEFAULT 10 COMMENT '续期账单数量',
  `new_add_bill` int(10) NOT NULL DEFAULT 0 COMMENT '新增账单',
  `new_add_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '新增账单占比',
  `repeat_bill_num` int(10) NOT NULL DEFAULT 0 COMMENT '复借账单数量',
  `repeat_bill_rate` float(3, 2) NOT NULL DEFAULT 0.00 COMMENT '复借账单占比',
  `all_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '总费用',
  `sms_send_num` int(10) NOT NULL DEFAULT 0 COMMENT '已发送短信数量',
  `sms_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '短信消费',
  `realname_num` int(10) NOT NULL DEFAULT 0 COMMENT '实名制认证数量',
  `realname_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '实名制认证消费',
  `zhima_cert_num` int(10) NOT NULL DEFAULT 0 COMMENT '芝麻分认证数量',
  `zhima_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '芝麻分认证消费',
  `bankcard_cert_num` int(10) NOT NULL DEFAULT 0 COMMENT '银行卡认证数量',
  `bankcard_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '银行卡认证消费',
  `operator_cert_num` int(10) NOT NULL DEFAULT 0 COMMENT '运营商认证数量',
  `operator_cost_amount` int(10) NOT NULL DEFAULT 0 COMMENT '运营商认证消费',
  PRIMARY KEY (`dateline`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

