DROP TABLE IF EXISTS `user_info`;
CREATE TABLE `user_info`  (
  `user_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '用户ID',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '姓名',
  `idcard` char(18) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '身份号码',
  `alipay_account` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '支付宝账号',
  `alipay_nick_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '支付宝昵称',
  `zhima_score` int(4) NOT NULL DEFAULT 0 COMMENT '芝麻评分',
  `bank_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '开户行',
  `bank_cardno` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '银行账号',
  `bank_mobile` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '银行预留手机号',
  `contacter` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '紧急联系人{relateion,name, mobile, r_key}',
  `idcard_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '实名认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `zhima_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '芝麻认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `contact_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '联系人认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `bank_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '银行卡认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `operator_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '运营商认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `alipay_verify` tinyint(1) NOT NULL COMMENT '支付宝认证状态 0未认证 1 认证成功  2 认证中  3 认证失败',
  `create_time` int(10) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1正常  2 删除',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '用户信息表' ROW_FORMAT = Dynamic;

