-- ----------------------------
-- Table structure for warn_record
-- ----------------------------
DROP TABLE IF EXISTS `warn_record`;
CREATE TABLE `warn_record`  (
  `warn_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '预警编号',
  `relation_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '内部流转交易号',
  `warn_type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '预警类型：1-部分还款验证码  2-出款预警  3-支付预警 4-申请借款预警  5-请订单累计达到10的倍数时预警',
  `remark` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '预警详情',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0-待处理，1-处理完成，2-处理失败',
  `warn_time` int(10) NOT NULL DEFAULT 0 COMMENT '预警时间',
  `deal_time` int(10) NOT NULL DEFAULT 0 COMMENT '预警处理时间',
  `deal_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '预警处理人',
  PRIMARY KEY (`warn_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统警告及预警' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of warn_record
-- ----------------------------

